(Bach Flowers Therapy) nedir?

🌀Bach Çiçekleri danışmanı eşliğinde, yapılan seans sonunda, 38 remedi içerisinden,ihtiyacımız olan remedinin seçilmesidir.

🌀Remediler, doğadaki bilge çiçeklerin bilgileridir. Birbirinden farklı ve güçlü Frekanslardır.

🌀Herbiri farklı duygu durumu ve zihin ürünü üzerinde etki gösterir. 

🌀Bach remedileri; korku,panik,öfke, fobiler, yalnızlık, odaklanamama, çekingenlik, özgüven eksikliği, takıntılar, hayır diyememe, başkalarının fikirlerinden etkilenip kendi iç sesini bastırma, beklenti, hayal kırıklığı,üşengeçlik, mükemmeliyetçilik, hedef belirleyememe,travmalar........gibi pek çok kalıptan kurtulmamızı sağlar. 

🌀Kendimizi tanıma, özümüzle buluşma yolundaki engelleri, blokajları temizlememize, duygu ve düşüncelerin hapishanesinde tutsak olmaktan kurtulup özgürleşmemize yardımcı olurlar.

🌀Bach remedileri, kullanılan herhangi bir ilaç veya gıda takviyesiyle etkileşime girmezler. 

🌀Yaş sınırı yoktur. Yeni doğan, hamileler, çocuklar, hastalar, yaş almışlar, hayvanlar ve bitkiler için kullanılabilir.

🌀Dönüşüme kendimizden başlayalım. 
